func (c *AlertPolicyCache) Update(ctx context.Context, in *AlertPolicy, modRev int64) {
	c.UpdateModFunc(ctx, in.GetKey(), modRev, func(old *AlertPolicy) (*AlertPolicy, bool) {
		return in, true
	})
}

func (c *AlertPolicyCache) UpdateModFunc(ctx context.Context, key *AlertPolicyKey, modRev int64, modFunc func(old *AlertPolicy) (new *AlertPolicy, changed bool)) {
	c.Mux.Lock()
	var old *AlertPolicy
	if oldData, found := c.Objs[*key]; found {
		old = oldData.Obj
	}
	new, changed := modFunc(old)
	if !changed {
		c.Mux.Unlock()
		return
	}
	if len(c.UpdatedCbs) > 0 || len(c.NotifyCbs) > 0 {
		newCopy := &AlertPolicy{}
		newCopy.DeepCopyIn(new)
		for _, cb := range c.UpdatedCbs {
			defer cb(ctx, old, newCopy)
		}
		for _, cb := range c.NotifyCbs {
			if cb != nil {
				defer cb(ctx, newCopy, modRev)
			}
		}
	}
	for _, cb := range c.UpdatedKeyCbs {
		defer cb(ctx, key)
	}
	store := &AlertPolicy{}
	store.DeepCopyIn(new)
	c.Objs[new.GetKeyVal()] = &AlertPolicyCacheData{
		Obj:    store,
		ModRev: modRev,
	}
	log.SpanLog(ctx, log.DebugLevelApi, "cache update", "new", store)
	c.Mux.Unlock()
	c.TriggerKeyWatchers(ctx, new.GetKey())
}

func (c *AlertPolicyCache) Delete(ctx context.Context, in *AlertPolicy, modRev int64) {
	c.DeleteCondFunc(ctx, in, modRev, func(old *AlertPolicy) bool {
		return true
	})
}

func (c *AlertPolicyCache) DeleteCondFunc(ctx context.Context, in *AlertPolicy, modRev int64, condFunc func(old *AlertPolicy) bool) {
	c.Mux.Lock()
	var old *AlertPolicy
	oldData, found := c.Objs[in.GetKeyVal()]
	if found {
		old = oldData.Obj
		if !condFunc(old) {
			c.Mux.Unlock()
			return
		}
	}
	delete(c.Objs, in.GetKeyVal())
	log.SpanLog(ctx, log.DebugLevelApi, "cache delete", "key", in.GetKeyVal())
	c.Mux.Unlock()
	obj := old
	if obj == nil {
		obj = in
	}
	for _, cb := range c.NotifyCbs {
		if cb != nil {
			cb(ctx, obj, modRev)
		}
	}
	if old != nil {
		for _, cb := range c.DeletedCbs {
			cb(ctx, old)
		}
	}
	for _, cb := range c.DeletedKeyCbs {
		cb(ctx, in.GetKey())
	}
	c.TriggerKeyWatchers(ctx, in.GetKey())
}

func (c *AlertPolicyCache) Prune(ctx context.Context, validKeys map[AlertPolicyKey]struct{}) {
	log.SpanLog(ctx, log.DebugLevelApi, "Prune AlertPolicy", "numValidKeys", len(validKeys))
	notify := make(map[AlertPolicyKey]*AlertPolicyCacheData)
	c.Mux.Lock()
	for key, _ := range c.Objs {
		if _, ok := validKeys[key]; !ok {
			if len(c.NotifyCbs) > 0 || len(c.DeletedKeyCbs) > 0 || len(c.DeletedCbs) > 0 {
				notify[key] = c.Objs[key]
			}
			delete(c.Objs, key)
		}
	}
	c.Mux.Unlock()
	for key, old := range notify {
		obj := old.Obj
		if obj == nil {
			obj = &AlertPolicy{}
			obj.SetKey(&key)
		}
		for _, cb := range c.NotifyCbs {
			if cb != nil {
				cb(ctx, obj, old.ModRev)
			}
		}
		for _, cb := range c.DeletedKeyCbs {
			cb(ctx, &key)
		}
		if old.Obj != nil {
			for _, cb := range c.DeletedCbs {
				cb(ctx, old.Obj)
			}
		}
		c.TriggerKeyWatchers(ctx, &key)
	}
}

